        ///                 cref="Options.FROM_SOURCE">FROM_SOURCE</see>:
        ///                 </term>
        ///                 <description>Shortest path to get to the source
        ///                 (inverse Dijkstra)</description>
        ///             </item>
        ///             <item>
        ///                 <term><see
        ///                 cref="Options.TO_SOURCE">TO_SOURCE</see>:</term>
